angular
    .module('dialogApp')
    .factory('Socket', ['$interval', function ($interval) {
        'use strict';

        var s = {
            queue: {},
            subscriptions: {},
            intervalHandler: null,
            timeoutHandler: null,
            session: null,
            instance: null,
            isConnecting: false,
            settings: null
        };

        // Add subscribe to session
        s.addSubscribe = function (key, funct) {
            var session = s.getSession();

            if (session) {
                s.subscriptions[key] = funct;

                session.subscribe(key, funct);
            } else {
                s.queue[key] = funct;

                // If not connected to socket - connect
                if (!s.isConnecting) {
                    s.connectToSocket();
                }
            }
        };

        // Connect to socket
        s.connectToSocket = function () {
            var socket = s.createInstance();

            if (!socket) {
                return false;
            }

            s.isConnecting = true;

            socket.on('socket/connect', function (session) {
                s.isConnecting = false;

                if (s.intervalHandler !== null) {
                    $interval.cancel(s.intervalHandler);
                }

                s.intervalHandler = null;

                s.setSession(session);

                $.each(s.subscriptions, function (key, funct) {
                    session.subscribe(key, funct);
                });

                $.each(s.queue, function (key, funct) {
                    session.subscribe(key, funct);

                    s.subscriptions[key] = funct;
                });

                s.queue = {};
                s.instance = socket;

                // For timeout avoid
                if (s.timeoutHandler === null) {
                    try {
                        s.timeoutHandler = $interval(function () {
                            session.publish('dialog/0', "{}");
                        }, 10000);
                    } catch (err) {
                    }
                }
            });

            socket.on("socket/disconnect", function (error) {
                var oldSession = s.getSession();

                if (oldSession !== null) {
                    oldSession.close();
                    oldSession._subscriptions = {};

                    s.setSession(null);
                }

                if (s.timeoutHandler !== null) {
                    $interval.cancel(s.timeoutHandler);

                    s.timeoutHandler = null;
                }

                s.intervalHandler = $interval(function () {
                    s.connectToSocket();
                }, 5000, 1);
            });
        };

        s.getSettingsByWindow = function () {
            if (window.app !== undefined) {
                s.settings = window.app.socket;
            }

            return null;
        };

        s.socket = function () {
            if (s.settings && !s.instance) {
                s.instance = s.createInstance();
            }

            return s.instance;
        };

        s.createInstance = function () {
            if (s.settings) {
                return WS.connect(s.settings.scheme + "://" + s.settings.host + ":" + s.settings.port, {maxRetries: 0});
            }

            return s.settings;
        };

        s.setSession = function (session) {
            s.session = session;
        };

        s.getSession = function () {
            return s.session;
        };

        s.getSettingsByWindow();

        return s;
    }]);

