        c.getStartDialogs = function (loadId) {
            c.DIALOG_LIMIT = 15;
            c.DIALOG_OFFSET = 0;
            c.dialogs = [];
            c.dialog = [];

            c.isLoadLastDialog = false;
            c.isLoadLastMessages = false;

            var data = {
                "limit": c.DIALOG_LIMIT,
                "offset": c.DIALOG_OFFSET,
                "show_deleted": c.isShowDeleted
            };

            if (c.selectFolder !== "all") {
                data.folder = c.selectFolder;
            }

            if (c.name != "") {
                data.name = c.name;
            }


            Dialog.all(data).success(function (data) {
                c.spinner = false;

                // If load all dialogs
                if (data.response.length < c.DIALOG_LIMIT) {
                    c.isLoadLastDialog = true;
                }

                // Update dialigs arr
                c.dialogs = data.response;

                c.isFirstLoaded = true;

                if (typeof loadId != "undefined") {
                    c.getDialogByid(loadId);

                    $.displayMessagePopup();
                }

                // If no dialogs
                if (!c.dialogs.length) {
                    return;
                }

                c.DIALOG_OFFSET += c.DIALOG_LIMIT;

                window.dialogsLoaded = true;

                if (window.displayDialogs === true) {
                    window.displayDialogs = false;

                    $.displayMessagePopup();

                    $rootScope.$broadcast('onOpenPopup');
                }

                setTimeout(function () {
                    c.watchScroll();
                }, 250);
            }).error(function (data) {
                ngDialog.open({
                    template: '/js/app/js/template/alert-popup.html',
                    className: 'ngdialog-theme-default alert-error',
                    data: data
                });
            });

        };

        // Load dialog list by scroll ()
        c.loadDialogs = function () {
            var data = {
                "limit": c.DIALOG_LIMIT,
                "offset": c.DIALOG_OFFSET,
                "show_deleted": c.isShowDeleted
            };

            if (c.selectFolder !== "all") {
                data.folder = c.selectFolder;
            }

            if (c.name != "") {
                data.name = c.name;
            }

            c.isLoadingDialog = true;

            //c.spinner = true;

            Dialog.all(data).success(function (data) {
                c.spinner = false;

                // If load all dialogs
                if (data.response.length < c.DIALOG_LIMIT) {
                    c.isLoadLastDialog = true;
                }
                var $lastDialog = $('#dialog-list-' + c.DIALOG_OFFSET);

                if (!$lastDialog.length) {
                    $lastDialog = $('.nano-content > ul.contacts_ul > span > li:last');
                }

                c.dialogs = c.dialogs.concat(data.response);

                setTimeout(function () {
                    if ($lastDialog) {
                        $(".scroll-dialogs").nanoScroller({scrollTo: $lastDialog});
                    }

                    c.DIALOG_OFFSET += c.DIALOG_LIMIT;

                    setTimeout(function () {
                        c.isLoadingDialog = false;
                    }, 100);
                }, 150);


            }).error(function (data) {
                ngDialog.open({
                    template: '/js/app/js/template/alert-popup.html',
                    className: 'ngdialog-theme-default alert-error',
                    data: data
                });
            });

        };

        // Load list by search name
        c.getDialogsBySearch = function (name) {
            c.name = name;

            c.getStartDialogs();
        };

        c.getProfileDialogs = function () {
            var data = {session: c.from.session};

            Dialog.all(data).success(function (data) {
                c.spinner = false;

                // Update dialigs arr
                c.dialogs = data.response;

                if (!c.dialogs.length) {
                    return;
                }

                // Get To
                c.to = c.dialogs[0].friend;

                // Get dialogs by To
                c.getDialogsById(c.to);

                // Set data for To service
                To.set(c.to);

                // Set selected dialog
                c.setDialog(c.dialogs[0]);

            }).error(function (data) {
                c.spinner = false;
                ngDialog.open({
                    template: '/js/app/js/template/alert-popup.html',
                    className: 'ngdialog-theme-default alert-error',
                    data: data
                });
            });

        };

        c.getDialogs = function () {
            var data = {
                "limit": c.DIALOG_OFFSET,
                "offset": 0
            };

            if (c.selectFolder !== "all") {
                data.folder = c.selectFolder;
            }

            Dialog.all(data).success(function (data) {

                // Update dialigs arr
                c.dialogs = data.response;

            }).error(function (data) {
                ngDialog.open({
                    template: '/js/app/js/template/alert-popup.html',
                    className: 'ngdialog-theme-default alert-error',
                    data: data
                });
            });

        };

        // Load dialogs by id friend
        c.getDialogsById = function (to) {
            if (c.to) {
                c.lastMessages[c.to.id] = c.content;
            }

            if (c.lastMessages[to.id] !== undefined) {
                c.content = c.lastMessages[to.id];
            } else {
                c.content = "";
            }

            c.LIMIT = 15;
            c.OFFSET = 0;
            c.to = to;

            c.isAdmin = c.to.isAdmin;
            c.isLoadLastMessages = false;

            // Set data for To service
            To.set(c.to);

            var data = {
                to: c.to.id,
                from_avatar: c.from.avatar,
                to_avatar: c.to.avatar,
                limit: c.LIMIT,
                offset: c.OFFSET,
                session: c.from.session
            };

            Dialog.getById(data).success(function (data) {
                var $input = $('body').find('div.text_input_messages');

                if ($input.length) {
                    $input.get(0).focus();
                    placeCaretAtEnd($input.get(0));
                }

                if (data.response.messages.length < c.LIMIT) {
                    c.isLoadLastMessages = true;
                }

                c.showPhoneWarning = true;
                c.showPhoneWarningId = 0;

                c.messages = data.response.messages;

                c.OFFSET += c.LIMIT;

                // Go scroll to bottom
                c.scrollToBottom();

                c.updateDialogByScroll(data.response);

                _.forEach(c.messages, function (message, key) {
                    if (message.read == false && message.from.id == c.to.id) {
                        Socket.getSession().publish('dialog/' + c.to.id, {
                            data: {
                                type: "friend_read_message",
                                data: {
                                    id: message.id
                                },
                                method: "publish"
                            }
                        });
                    }
                });
            }).error(function (data) {
                ngDialog.open({
                    template: '/js/app/js/template/alert-popup.html',
                    className: 'ngdialog-theme-default alert-error',
                    data: data
                });
            });

        };

        c.getDialogByid = function (id) {
            var isLoadNew = true;

            // If dialog loaded in list
            _.forEach(c.dialogs, function (dialog, key) {
                if (id == dialog.friend.id) {

                    c.dialogs.unshift(c.dialogs.splice(key, 1)[0]);

                    c.getDialogsById(dialog.friend);

                    isLoadNew = false;
                }
            });

            if (isLoadNew) {
                Dialog.getDialogByid(id).success(function (data) {
                    var dialog = data.response;

                    dialog.lastMessage = "";
                    dialog.friend.isFirstTime = dialog.isFirstTime;

                    c.dialogs.unshift(dialog);
                    c.getDialogsById(dialog.friend);
                }).error(function (data) {
                    ngDialog.open({
                        template: '/js/app/js/template/alert-popup.html',
                        className: 'ngdialog-theme-default alert-error',
                        data: data
                    });
                });
            }
        };

        // Set selected dialog
        c.setDialog = function (dialog) {
            c.dialog = dialog;
        };

        // Load dialog messages
        c.loadDialogsByScroll = function () {
            var data = {
                to: c.to.id,
                from_avatar: c.from.avatar,
                to_avatar: c.to.avatar,
                limit: c.LIMIT,
                offset: c.OFFSET,
                session: c.from.session
            };

            Dialog.getById(data).success(function (data) {
                if (!data.response.loadMore) {
                    c.isLoadLastMessages = true;
                }

                c.messages = c.messages.concat(data.response.messages);

                c.OFFSET += c.LIMIT;

                c.updateDialogByScroll(data.response);

                if (!c.isLoadLastMessages) {
                    setTimeout(function () {
                        $(".nano-scroll-messages").nanoScroller({scrollTo: $('#message-14')});
                    }, 350);

                }
            }).error(function (data) {
                ngDialog.open({
                    template: '/js/app/js/template/alert-popup.html',
                    className: 'ngdialog-theme-default alert-error',
                    data: data
                });
            });

        };

        c.getCountNewMessages = function (count) {
            Dialog.updateUnreadMessages(count);
        };

        // Send message
        c.addMessage = function (message) {
            message = $.trim(message);
            message = message.replace(/^\s*(?:<br\s*\/?\s*>)+|(?:<br\s*\/?\s*>)+\s*$/g, '').replace(/^\s*(?:\&nbsp;[ ]*)+|(?:\&nbsp;[ ]*)+\s*$/g, '').replace(/^\s*(?:<br\s*\/?\s*>)+|(?:<br\s*\/?\s*>)+\s*$/g, '');
            message = $.trim(message);

            if (!message) {
                return;
            }

            c.content = "";

            if (message) {
                var date = new Date;
                var hash = ("0000" + (Math.random() * Math.pow(36, 4) << 0).toString(36)).slice(-4) + Date.now();

                c.messagesHashes.push(hash);

                c.messages.unshift({
                    created_at: date.toTimeString().substr(0, 5),
                    from: User.get(),
                    images: [],
                    message: message,
                    shortMessage: message,
                    time: date.getHours() + ":" + date.getMinutes(),
                    hash: hash,
                    isNew: true
                });

                $('.nano-scroll-messages').nanoScroller({scroll: 'bottom'});
            } else {
                var hash = "";
            }

            var session = Socket.getSession();

            if (session !== null) {
                session.publish('dialog/' + c.from.id, {
                    data: {
                        message: message,
                        from: {id: c.from.id},
                        to: {id: c.to.id},
                        images: [],
                        hash: hash,
                        method: "send"
                    }
                });
            } else {
                Dialog.add(c.to, {
                    message: message,
                    images: [],
                    hash: hash
                }).then(function () {
                    c.messages[0].sent = true;
                }, function error(response) {
                    if (response.data && response.data.error_message == '  ') {
                        var $block = $('[data-popup-block="popup_men_confirm_mail"]');

                        if ($block.length) {
                            $.displayPopup($('[data-popup-block="popup_men_confirm_mail"]'));
                        } else {
                            ngDialog.open({
                                template: '/js/app/js/template/alert-popup.html?v=0.01',
                                className: 'ngdialog-theme-default has-error',
                                data: response.data
                            });
                        }
                    } else {
                        ngDialog.open({
                            template: '/js/app/js/template/alert-popup.html?v=0.01',
                            className: 'ngdialog-theme-default has-error',
                            data: response.data
                        });
                    }
                });
            }
        };

        c.openDialogById = function (data) {
            var id = data.id;

            if (!c.isFirstLoaded) {
                c.getStartDialogs(id);
            } else {
                Dialog.all({
                    "limit": c.DIALOG_OFFSET,
                    "offset": 0,
                    "session": c.from.session
                }).success(function (data) {
                    // Update dialigs arr
                    c.dialogs = data.response;

                    $.displayMessagePopup();

                    c.getDialogByid(id);
                }).error(function (data) {
                    ngDialog.open({
                        template: '/js/app/js/template/alert-popup.html',
                        className: 'ngdialog-theme-default alert-error',
                        data: data
                    });
                });
            }
        };

        // Return active css class for dialog list
        c.isActive = function (to) {
            return (c.to && to.id == c.to.id);
        };

        // Send smile
        c.sendSmile = function (smile) {
            c.content += emojione.toImage(smile);
            //   
            c.content += '<div class="hidden">' + smile + '</div>';
            $('.text_input_messages').addClass('edited_no_ph');
        };

        // Scroll to bottom
        c.scrollToBottom = function () {
            setTimeout(function () {
                $('.nano-scroll-messages').nanoScroller({scroll: 'bottom'});
            }, 250);
        };

        // Scrolling to top
        c.scrollToTop = function () {
            $('.nano-scroll-messages').nanoScroller({scroll: 'top'});
        };

        c.watchScroll = function () {
            // Load messages
            $(".nano-scroll-messages").bind("scrolltop", function () {
                if (!c.isLoadLastMessages) {
                    c.loadDialogsByScroll();
                }
            });

            // Load dialogs
            $(".scroll-dialogs").bind("scrollend", function () {
                if (!c.isLoadingDialog && !c.isLoadLastDialog) {
                    c.loadDialogs();
                }
            });
        };

        // Socket
        c.socketWatch = function () {
            if (!c.from) {
                return false;
            }

            var $function = function (uri, payload) {
                if (typeof payload['data'] == "string") {
                    var data = jQuery.parseJSON(payload['data']);
                } else {
                    var data = payload['data'];
                }

                // Notification came
                if (data.type !== undefined) {
                    // If firend read our message
                    if (data.type == "friend_read_message") {
                        var id = data.data.id;

                        _.forEach(c.messages, function (currentMessage, key) {
                            if (currentMessage.id == id) {
                                c.messages[key].read = true;
                                c.messages[key].sent = false;

                                return false;
                            }
                        });
                    }

                    return false;
                }

                if (!c.dialogs.length) {
                    c.getStartDialogs();

                    return;
                }

                // If we received error
                if ("error" in data) {
                    if (!data.error) {
                        var errorData = {
                            error_code: 1,
                            error_message: "    "
                        };
                    } else {
                        var errorData = {
                            error_code: 500,
                            error_message: data.error
                        };
                    }


                    if (data.error && data.error == '  .      .') {
                        var $block = $('[data-popup-block="popup_men_confirm_mail"]');

                        if ($block.length) {
                            $.displayPopup($('[data-popup-block="popup_men_confirm_mail"]'));
                        } else {
                            ngDialog.open({
                                template: '/js/app/js/template/alert-popup.html?v=0.01',
                                className: 'ngdialog-theme-default alert-error',
                                data: errorData
                            });
                        }
                    } else {
                        ngDialog.open({
                            template: '/js/app/js/template/alert-popup.html?v=0.01',
                            className: 'ngdialog-theme-default alert-error',
                            data: errorData
                        });
                    }

                    if ("hash" in data && data.hash) {
                        _.forEach(c.messages, function (message, key) {
                            if (message && "hash" in message && message.hash == data.hash) {
                                c.messages.splice(key, 1);

                                var messageHashIndex = c.messagesHashes.indexOf(message.hash);

                                if (messageHashIndex != -1) {
                                    c.messagesHashes.splice(messageHashIndex, 1);
                                }

                                var $input = $('body div.text_input_messages');

                                $input.html(message.message);
                                $input.get(0).focus();

                                placeCaretAtEnd($input.get(0));

                                $('body').one('click', function () {
                                    placeCaretAtEnd($('body div.text_input_messages').get(0));
                                });

                                return false;
                            }
                        });
                    }

                    return;
                }

                var text = data.message;
                text = (text + '').replace(/([^>\r\n]?)(\r\n|\n\r|\r|\n)/g, '$1<br>$2');

                var message = {
                    "id": data.id,
                    "from": data.from,
                    "to": data.to,
                    "message": text,
                    "shortMessage": data.short_message,
                    "images": data.images,
                    "is_gift": data.is_gift,
                    "gift": data.gift,
                    "created_at": data.time,
                    "time": data.time,
                    "is_new": false,
                    "hash": data.hash,
                    "contains_phone": data.contains_phone
                };

                // Update dialog list
                c.updateDialog(message);

                // If not select dialog
                if (!c.to) {
                    return;
                }

                // c dialog == Who send
                if (c.to.id == data.from.id || c.from.id == data.from.id && c.to.id == data.to.id) {
                    if (!message.hash || c.messagesHashes.indexOf(message.hash) == -1) {
                        message.message = message.message.replace(/(?:\r\n|\r|\n)/g, '<br>');

                        c.messages.unshift(message);

                        $scope.$apply();

                        // If we sent message from other tab
                        if (c.from.id == data.from.id) {
                            $('.nano-scroll-messages').nanoScroller({scroll: 'bottom'});
                        }
                    } else if (c.messagesHashes.indexOf(message.hash) >= 0) {
                        _.forEach(c.messages, function (currentMessage, key) {
                            if ("hash" in currentMessage && currentMessage.hash == message.hash) {
                                c.messages[key].sent = true;
                                c.messages[key].is_new = true;
                                c.messages[key].id = message.id;
                                c.messages[key].message = message.message;
                                c.messages[key].contains_phone = message.contains_phone;

                                return false;
                            }
                        });
                    }
                }
            };

            Socket.addSubscribe("dialog/" + c.from.id, $function);
        };

        // Update dialog list
        c.updateDialog = function (data) {
            var oldData = data;

            var isLoadNew = true;
            var isVisiblePopup = $('.messagePopup').is(':visible');

            // If dialog not open
            if (!c.to) {
                _.forEach(c.dialogs, function (dialog, key) {
                    if (data.from.id == dialog.friend.id && data.from.id != c.from.id) {
                        // Update message in dialogs list
                        c.dialogs[key].lastMessage = data.shortMessage;
                        c.dialogs[key].unreadMessages = data.to.tabUnreadMessages;
                        c.dialogs[key].time = data.time;
                        c.dialogs[key].friend.isOnline = true;

                        c.getCountNewMessages(1);

                        // On / Off sound
                        if (data.from.sound) c.soundMessage();

                        // Sort first position
                        c.dialogs.unshift(c.dialogs.splice(key, 1)[0]);

                        $scope.$apply();
                        // alert(data.to.unreadMessages);
                        isLoadNew = false;

                        return false;
                    }
                });

                // Add new dialog
                if (isLoadNew) {
                    c.addDialog(data);
                }

                return;
            }

            // If dialog open
            _.forEach(c.dialogs, function (dialog, key) {
                if (dialog.friend.id == oldData.from.id && oldData.from.id != c.from.id) {

                    // Update message in dialogs list
                    c.dialogs[key].lastMessage = oldData.shortMessage;
                    c.dialogs[key].time = oldData.time;
                    c.dialogs[key].friend.isOnline = true;

                    // Update counter
                    if (dialog.friend.id != c.to.id) {
                        c.dialogs[key].unreadMessages = oldData.to.tabUnreadMessages;
                        c.getCountNewMessages(1);
                    } else {
                        if (isVisiblePopup) {
                            var session = Socket.getSession();

                            var publishData = {
                                data: {
                                    type: "read_messages",
                                    data: {
                                        "ids": [data.id]
                                    },
                                    "method": "send"
                                }
                            };

                            session.publish('dialog/' + c.from.id, publishData);
                            session.publish('dialog/' + dialog.friend.id, {
                                data: {
                                    type: "friend_read_message",
                                    data: {
                                        id: data.id
                                    },
                                    method: "publish"
                                }
                            });
                        } else {
                            c.getCountNewMessages(1);
                        }
                    }

                    // On / Off sound
                    if (oldData.from.sound) c.soundMessage();

                    // Sort first position
                    c.dialogs.unshift(c.dialogs.splice(key, 1)[0]);

                    $scope.$apply();

                    isLoadNew = false;
                }
            });

            // Add new dialog
            if (isLoadNew) {
                c.addDialog(data);
            }
        };

        c.addDialog = function (data) {
            var dialog = {
                "createdAt": data.time,
                "from": data.to,
                "friend": data.from,
                "gift": data.gift,
                "isGift": data.isGift,
                "images": data.images,
                "lastMessage": data.shortMessage,
                "message": data.message,
                "unreadMessages": data.to.tabUnreadMessages,
                "time": data.time
            };

            c.dialogs.unshift(dialog);

            c.DIALOG_OFFSET += 1;

            $scope.$apply();
        };

        // Update dialog list by scroll
        c.updateDialogByScroll = function (data) {

            $rootScope.$emit('getUnreadMessagesCount');

            // _.find( data.messages )
            var _from = _.last(_.filter(data.messages, function (item) {
                return item.from.id != c.from.id;
            }));

            if (!_from) {
                return;
            }

            _.forEach(c.dialogs, function (dialog, key) {
                if (_from && dialog.friend.id == _from.from.id) {
                    c.dialogs[key].unreadMessages = data.tabUnreadMessages;
                }
            });

        };

