angular
    .module('dialogApp')
    .controller('smileCtrl', ['$scope', '$timeout', 'Smile', function ($scope, $timeout, Smile) {

        'use strict';

        var c = {};

        $scope.smiles = [];
        $scope.isLoading = false;
        $scope.isLastLoad = false;

        c.LIMIT = 50;
        c.OFFSET = 0;

        // Get all gifts
        c.getSmiles = function () {
            var emojiesArr = Smile.userSmiles.split('::');

            emojiesArr = emojiesArr.slice(c.OFFSET, (c.LIMIT + c.OFFSET));

            var list = [];
            _.forEach(emojiesArr, function (name, key) {
                var smile = ":" + name + ":";

                list.push({
                    "key": smile,
                    "image": Smile.shortnameToImage(smile),
                    "unicode": Smile.shortnameToUnicode(smile)
                });
            });

            $scope.smiles = list;

            c.OFFSET += c.LIMIT;
        };

        // Get all gifts
        c.loadSmiles = function () {

            c.isLoading = true;

            // var emojies = Smile.shortnames.split('|');
            var emojiesArr = Smile.userSmiles.split('::');

            emojiesArr = emojiesArr.slice(c.OFFSET, (c.LIMIT + c.OFFSET));

            // console.log($scope.smiles)

            var list = [];
            _.forEach(emojiesArr, function (name, key) {

                var smile = ":" + name + ":";

                var data = {
                    "key": smile,
                    "image": Smile.shortnameToImage(smile),
                    "unicode": Smile.shortnameToUnicode(smile)
                };

                list.push(data);

            });

            $scope.$apply(function () {
                $scope.smiles = $scope.smiles.concat(list);
            });

            if (list < c.LIMIT) {
                c.isLastLoad = true;
            }

            c.OFFSET += c.LIMIT;

            // $scope.$digest();
            // $scope.$apply();

            $(".smiles-scroll").nanoScroller({scrollBottom: 200});

            c.isLoading = false;

        };

        // Watch to event scroll
        c.watchScroll = function () {
            $(".smiles-scroll").bind("scrollend", function (e) {
                if (!c.isLoading && !c.isLastLoad) {
                    c.loadSmiles();
                }
            });
        };

        c.getSmiles();
        c.watchScroll();

        return c;
    }]);

